  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Salt Plains NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Salt Plains NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge resources, information
  about the management direction, and strategies for implementation. Key planning
  issues include: wildlife management, habitat management, public use, partnerships,
  Refuge administration, land protection, cultural resources, water quality, and threatened
  and endangered species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
